import Layout from "../components/gallery/Layout";
import Product from "../components/gallery/Gallery";
import client from "../components/ApolloClient";
import MEDIA_LIST from "../queries/mediaitems";


const gallery = ( props ) => {
	console.warn( props );
	const { products } = props;
	return( 
		<Layout>
            <div className="product-container">
				{ products.length ? (
					products.map( product => <Gallery key={ product.id } product={ product }/> )
						) : '' }
			</div>
        </Layout>
		)
	};
	Shop.getInitialProps = async () => {

		const result = await client.query( {
			query: MEDIA_LIST,
		} );
	
		return {
			products: result.data.mediaItems.nodes,
		}
	
	};
	
	export default gallery;
